import { createApp } from 'vue';
import { createRouter, createWebHistory } from 'vue-router';
import { createPinia } from 'pinia';
import App from './App.vue';
import routes from './router';
import { Tabbar, TabbarItem, NavBar, Field, Form, Button, RadioGroup, Radio, 
  CheckboxGroup, Checkbox, Cell, CellGroup, Popup, DatetimePicker, Picker, Step, Steps, Toast } from 'vant';
import 'vant/lib/index.css';

// 创建路由实例
const router = createRouter({
  history: createWebHistory(),
  routes,
});

// 创建Pinia状态管理实例
const pinia = createPinia();

// 创建Vue应用实例
const app = createApp(App);

// 注册Vant组件
const vantComponents = [
  Tabbar, TabbarItem, NavBar, Field, Form, Button, RadioGroup, Radio, 
  CheckboxGroup, Checkbox, Cell, CellGroup, Popup, DatetimePicker, Picker, Step, Steps
];

vantComponents.forEach(component => {
  app.use(component);
});

// 全局注册Toast方法
app.config.globalProperties.$toast = Toast;

// 使用插件
app.use(router);
app.use(pinia);

// 挂载应用
app.mount('#app');
